let frames = vidData.split("/");//Separates each frame from the data string
let musicRows = musicData.split(",");
let frameId = 0;
let musicRow = 0;
let rowId = 0;
let playbackSpeed = 15;

let isPlaying = false;

//Initializes a framebuffer array of 64 80-pixel lines + a newline (doing it that way makes frame "generation" easier)
let fb = [];
for(let y = 0; y < 64; y++){
  for(let x = 0; x < 80; x++){
    fb.push(0);
  }
  fb.push("\n");
}

function init(){
  
  setMap(`0`);//Nothing displays if I don't have this so I'll keep it until I find a fix
  
  addText("Bad Apple!", {x: 5,y: 3,color: color`2`})
  addText("J:15Fps", {x: 2,y: 10,color: color`2`})
  addText("L:30Fps", {x: 11,y: 10,color: color`2`})

  onInput("j", () => {
    if(!isPlaying) playVid();
  })

  onInput("l", () => {
    if(!isPlaying){
      playbackSpeed = 30;
      playVid();
    }
  })
}

function playVid(){
  isPlaying = true;
  clearText();
  playMusic();
  
  setInterval( () => {
    if (frameId < frames.length){
      tick();
      frameId++;
      if(playbackSpeed == 15) frameId++;
    }
  }, (1 / playbackSpeed) * 1000);//Makes the function run exactly 30 times a second (probably)
}

function playMusic(){
  setInterval( () => {
    if(musicRow < musicRows.length){
      playTune(musicRows[musicRow]);
      musicRow++;
    }
  }, 108.6956521739);
}

function tick(){
  let segments = frames[frameId].split(",");//Creates an array with each RLE segment from the frame
  let pxId = 0;
  
  for(let segment = 0; segment < segments.length; segment++){
    let seg = parseInt(segments[segment]);//Let's pretend I didn't forget to add the parseInt() and didn't struggle a whole day figuring out why running this project crashed the tab
    for(let px = 0; px < seg; px++){
      fb[Math.floor((px + pxId) / 80) * 81 + (px + pxId) % 80] = segment % 2;
    }
    pxId += seg;
  }

  let frame = fb.join(``);//Makes the framebuffer into a parsable string
  
  setMap(frame);
}

init();
